// Helper function to get SVG data by class name
static const char* get_emoji_svg(const char* class_name) {
    for (const auto& entry : emoji_svg_table) {
        if (entry.class_name && strcmp(entry.class_name, class_name) == 0) {
            return entry.svg_data;
        }
    }
    return nullptr;
}

static const size_t EMOJI_SVG_COUNT = 80;

// Helper function to get class name from COCO class ID (0-79)
static const char* get_coco_class_name(int class_id) {
    // COCO dataset class names (80 classes) - must match YOLOv8 output order
    static const char* coco_class_names[] = {
        "person", "bicycle", "car", "motorbike", "aeroplane", "bus", "train", "truck", "boat", "traffic light",
        "fire hydrant", "stop sign", "parking meter", "bench", "bird", "cat", "dog", "horse", "sheep", "cow",
        "elephant", "bear", "zebra", "giraffe", "backpack", "umbrella", "handbag", "tie", "suitcase", "frisbee",
        "skis", "snowboard", "sports ball", "kite", "baseball bat", "baseball glove", "skateboard", "surfboard",
        "tennis racket", "bottle", "wine glass", "cup", "fork", "knife", "spoon", "bowl", "banana", "apple",
        "sandwich", "orange", "broccoli", "carrot", "hot dog", "pizza", "donut", "cake", "chair", "sofa",
        "pottedplant", "bed", "diningtable", "toilet", "tvmonitor", "laptop", "mouse", "remote", "keyboard",
        "cell phone", "microwave", "oven", "toaster", "sink", "refrigerator", "book", "clock", "vase", "scissors",
        "teddy bear", "hair drier", "toothbrush"
    };
    
    const int num_classes = sizeof(coco_class_names) / sizeof(coco_class_names[0]);
    
    if (class_id >= 0 && class_id < num_classes) {
        return coco_class_names[class_id];
    }
    return "unknown";
}

// Helper function to get SVG data by COCO class ID
static const char* get_emoji_svg_by_id(int class_id) {
    const char* class_name = get_coco_class_name(class_id);
    return get_emoji_svg(class_name);
}

